INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (122, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"type": "message", "subtype": "message_changed", "hidden": true, "message": {"client_msg_id": "759107a1-60f1-447c-a35d-96cd0dc61674", "type": "message", "text": "<https://docs.microsoft.com/en-us/powershell/module/microsoft.powershell.security/set-executionpolicy?view=powershell-6>", "user": "UGCKJ22GY", "team": "TGDAJ0S3E", "attachments": [{"title": "Set-ExecutionPolicy (Microsoft.PowerShell.Security)", "title_link": "https://docs.microsoft.com/en-us/powershell/module/microsoft.powershell.security/set-executionpolicy?view=powershell-6", "text": "The Set-ExecutionPolicy cmdlet changes PowerShell execution policies for Windows computers. For more information, see about_Execution_Policies. For non-Windows computers, the default execution policy is Unrestricted and cannot be changed. The Set-ExecutionPolicy cmdlet is available, but PowerShell displays a console message that it''s not supported. An execution policy is part of the PowerShell security strategy. Execution policies determine whether you can load configuration files, such as your PowerShell profile, or run scripts. And, whether scripts must be digitally signed before they are run. The Set-ExecutionPolicy cmdlet''s default scope is LocalMachine, which affects everyone who uses the computer. To change the execution policy for LocalMachine, start PowerShell with Run as Administrator. To display the execution policies for each scope in the order of precedence, use Get-ExecutionPolicy -List. To see the effective execution policy for your PowerShell session use Get-ExecutionPolicy with no parameters.", "fallback": "Set-ExecutionPolicy (Microsoft.PowerShell.Security)", "thumb_url": "https://docs.microsoft.com/en-us/media/logos/logo-ms-social.png", "from_url": "https://docs.microsoft.com/en-us/powershell/module/microsoft.powershell.security/set-executionpolicy?view=powershell-6", "thumb_width": 400, "thumb_height": 400, "service_icon": "https://docs.microsoft.com/favicon.ico", "service_name": "docs.microsoft.com", "id": 1, "original_url": "https://docs.microsoft.com/en-us/powershell/module/microsoft.powershell.security/set-executionpolicy?view=powershell-6"}], "ts": "1571784424.003700"}, "channel": "DJEMXU76K", "previous_message": {"client_msg_id": "759107a1-60f1-447c-a35d-96cd0dc61674", "type": "message", "text": "<https://docs.microsoft.com/en-us/powershell/module/microsoft.powershell.security/set-executionpolicy?view=powershell-6>", "user": "UGCKJ22GY", "ts": "1571784424.003700", "team": "TGDAJ0S3E"}, "event_ts": "1571784425.003800", "ts": "1571784425.003800", "channel_type": "im"}, "type": "event_callback", "event_id": "EvPADV72US", "event_time": 1571784425, "authed_users": ["UGCKJ22GY"]}', NULL);
