INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (335, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "a3c0d475-d415-4dad-8bc9-eef51cbdc33f", "type": "message", "text": "Free Chrome extension that enforces 25min/5min strict workflow by blocking distractions during those 25 minutes:\n<https://chrome.google.com/webstore/detail/strict-workflow/cgmnfnmlficgeijcalkgnnkigkefkbhd?hl=en>\n\nWorth noting is that the \"work\" time means blocking select websites until \"break\" time, when one can browse the web freely. One thing worth noting is that this structure indirectly enforces any websites the user selects to block (likely social media or other mentally-active _and_ contextually-unrelated activities - they''re unwanted distractions _because_ they''re both engaging and unrelated) as the context of one''s break. Whereas a \"cooldown\" period of very low mental workload (like the example of tech workers standing at the water cooler with headphones doing next to nothing) is preferred in order to maintain a state of \"flow\"; switching contexts to things that still engage one mentally isn''t fully addressing the problem it aims to.", "user": "UJCRT0WJH", "ts": "1572048488.000900", "team": "TGDAJ0S3E", "channel": "CLMNJJN6M", "event_ts": "1572048488.000900", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvPU4Q0664", "event_time": 1572048488, "authed_users": ["UGCKJ22GY"]}', NULL);
