INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (371, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"type": "file_change", "file_id": "FPUFAN12L", "user_id": "UJCRT0WJH", "file": {"id": "FPUFAN12L"}, "event_ts": "1572113010.003000"}, "type": "event_callback", "event_id": "EvPLJ3H4GH", "event_time": 1572113010, "authed_users": ["UGCKJ22GY"]}', NULL);
INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (373, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "d9b54054-7bed-45d8-afc3-adfac40b5842", "type": "message", "text": "*BET100 pitch:*\n\n57% of Silicon Valley tech sector employees feel burned out at work, leading to decreased performance, well-being, and high turnover rates. The modern tech workplace is full of distracting notifications and messages from many sources as individuals juggle multiple tasks and responsibilities; this constant gear-switching and lack of focus or agency leads to high cognitive load, a major cause of preventable burnout. FocusPocus is an app that lets individuals reclaim control of their mental resources by auto-generating customizable daily schedules including time blocks when users can focus on single, specific tasks free of interruption. During these blocks, regular short \u201ccooldown\u201d intervals can be leveraged to boost productivity and energy, while notifications and other distractions can be intelligently suppressed or delayed so that individuals can stay focused without worrying about missing important or time-sensitive messages.\n\nFocusPocus - Work like magic!\u2122", "user": "UJCRT0WJH", "ts": "1572117661.000700", "team": "TGDAJ0S3E", "channel": "CMUKLK4HL", "event_ts": "1572117661.000700", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvPFNETWRY", "event_time": 1572117661, "authed_users": ["UGCKJ22GY"]}', NULL);
INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (375, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"type": "message", "subtype": "message_changed", "hidden": true, "message": {"client_msg_id": "99ba3d39-5d33-4c35-8f49-bd0a59a125fd", "type": "message", "text": "Good stuff!\n\n<@UJCRT0WJH> can you find a more realistic/credible number we can use for tech workers instead of the 57% figure? That number comes from a one-question poll on the Blind app (anonymous social network)  The Gallup numbers are more credible but general to all employees. We need a study of burnout rate more specific to our target audience: \"tech workers\" or \"millennials\" or \"knowledge workers\" etc.\n\nGallup''s numbers as reference:\n&gt; \"Organizations are facing an employee burnout crisis. A recent Gallup study of nearly 7,500 full-time employees found that 23% of employees reported feeling burned out at work very often or always, while an additional 44% reported feeling burned out sometimes. That means about two-thirds of full-time workers experience burnout on the job.\"\n(<https://www.gallup.com/workplace/237059/employee-burnout-part-main-causes.aspx>)", "user": "UGDBV8GDQ", "team": "TGDAJ0S3E", "attachments": [{"service_name": "Gallup.com", "title": "Employee Burnout, Part 1: The 5 Main Causes", "title_link": "https://www.gallup.com/workplace/237059/employee-burnout-part-main-causes.aspx", "text": "Discover the top five causes of employee burnout, and find out who plays the biggest role in preventing it.", "fallback": "Gallup.com: Employee Burnout, Part 1: The 5 Main Causes", "image_url": "https://content.gallup.com/origin/gallupinc/GallupSpaces/Production/Cms/WORKPLACEV9CMS/yfdjuue8akybvg-gt3tzyg.jpg", "ts": 1531378800, "from_url": "https://www.gallup.com/workplace/237059/employee-burnout-part-main-causes.aspx", "image_width": 478, "image_height": 250, "image_bytes": 115119, "service_icon": "http://content.gallup.com/origin/gallupinc/GallupSpaces/Production/Cms/WWWV7CORP/wqznbuenn0mf6uax4c2ana.png", "id": 1, "original_url": "https://www.gallup.com/workplace/237059/employee-burnout-part-main-causes.aspx"}], "ts": "1572118744.009100"}, "channel": "CMUKLK4HL", "previous_message": {"client_msg_id": "99ba3d39-5d33-4c35-8f49-bd0a59a125fd", "type": "message", "text": "Good stuff!\n\n<@UJCRT0WJH> can you find a more realistic/credible number we can use for tech workers instead of the 57% figure? That number comes from a one-question poll on the Blind app (anonymous social network)  The Gallup numbers are more credible but general to all employees. We need a study of burnout rate more specific to our target audience: \"tech workers\" or \"millennials\" or \"knowledge workers\" etc.\n\nGallup''s numbers as reference:\n&gt; \"Organizations are facing an employee burnout crisis. A recent Gallup study of nearly 7,500 full-time employees found that 23% of employees reported feeling burned out at work very often or always, while an additional 44% reported feeling burned out sometimes. That means about two-thirds of full-time workers experience burnout on the job.\"\n(<https://www.gallup.com/workplace/237059/employee-burnout-part-main-causes.aspx>)", "user": "UGDBV8GDQ", "ts": "1572118744.009100", "team": "TGDAJ0S3E"}, "event_ts": "1572118745.009200", "ts": "1572118745.009200", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvPWC0S40P", "event_time": 1572118745, "authed_users": ["UGCKJ22GY"]}', NULL);
