INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (406, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "c6aa602e-f5e2-4af0-b736-6e958e9b7248", "type": "message", "text": "General ideas for setting up an API (SHIP THESE IN SMALL PIECES):\n- Setting up API connection / authentication: Making someone able to give us access to their data using the click of a button (usually uses OAuth or JSON Web token)\n- This involves designing a repeatable process that is safe\n- Thinking about data structures: Organizational data (e.g. Organization Github ID, organization API access key, etc.)\n- Designing an _initial_ data acquisition flow: When a user / organization first authenticates, we need a script which will acquire data from their organization\n- Then we need a job which will update our data from their organization with exactly once delivery: we want each individual Git commit _only once_\n\nAsk lots of questions and share ideas", "user": "UGCKJ22GY", "ts": "1572143860.005200", "team": "TGDAJ0S3E", "channel": "CGD8ER3HR", "event_ts": "1572143860.005200", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvPFRWQY02", "event_time": 1572143860, "authed_users": ["UGCKJ22GY"]}', NULL);
