INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (423, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"type": "reaction_added", "user": "UJCRT0WJH", "item": {"type": "message", "channel": "CGEDVJHPH", "ts": "1571151837.000800"}, "reaction": "+1", "item_user": "UGCKJ22GY", "event_ts": "1572149653.000500"}, "type": "event_callback", "event_id": "EvPLNZPKH7", "event_time": 1572149653, "authed_users": ["UGCKJ22GY"]}', NULL);
INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (424, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "4f21ff06-c42b-4a0e-97d8-1fcf9df8ff32", "type": "message", "text": "```\nGreetings Laurier,\n \nIt was a great conversation today, and a pleasure to meet you. Here is some additional reviewer feedback to support you with next steps:\n \n- Be careful about the linear calculation. There are other ways to quantify the \"size of the burnout problem\" such as how much is spent on employee wellness.\n- Define a stronger business case \u2013 who cares about this problem? What industry has something to gain or lose from solving the problem?\n- Define your terms to provide further definition around your problem - how is burnout defined and measured so that an organization knows how to prevent it? (ie. Maslach Burnout Inventory)  - Identify systemic issues within the problem that can be affected by a solution.\n- Some socio-economic issues addressed - unclear what element of the problem is being addressed. \n- What is the context of the burnout?\n- From a historical context, burnout is expressed as a lack of spiritual wellbeing in the bible, it was defined as sloth in the middle ages, etc. Is this a more recent phenomena - when did it reach its peak? What has been tried throughout the ages? Opportunity to refine the story around burnout and address the millions spent trying to address it (ie. workplace wellness industry)\n- Important to make clear whether this is scheduling leisure (outside of work) activities or work because the HBR source they quote says millennials are less likely to take vacation, not that they don''t have time to attend events for work or it is difficult to schedule work events\n- One final reminder to ensure you stay clear of a solution. Your goal is to demonstrate your understanding of the problem and you will be evaluated on its analysis.\n \nLet me know if you need additional support.\nKind regards,\nCrista Renner\n```", "user": "UGCKJ22GY", "ts": "1572150136.010800", "team": "TGDAJ0S3E", "channel": "CMUKLK4HL", "event_ts": "1572150136.010800", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvPH6EGS75", "event_time": 1572150136, "authed_users": ["UGCKJ22GY"]}', NULL);
