INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (490, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "4b05d10a-8d0f-4d29-b21e-5a53e782b378", "type": "message", "text": "```\nRead \"Zucked\". \nIt should have been entitled ''The End of Democracy''. \nFacebook is for the vain and the insecure. Algorithms are controlling minds and governments.\nFacebook is really the most corrupt and evil entity. \nRoger McNamee is WAY too soft on Facebook and Zuckerberg. \nFuck you, Mark. Do you not see the disastrous consequences of what you are doing? You are responsible for the rise for teen suicide rates. Depression. Genocides. Myanmar. \nElecting right wing rulers. \nThree people from FB went into the Trump campaign with the goal of misinforming people. \nIs that not blatant corruption??? \nI''m sure this post will be taken down. \nMcNamee says that FB could still be honest and decent if they fixed a few things. \nRight now,it''s corrupt AND it''s EVIL. \nAn absolutely eye-opening and frightening read. \nBUT,\nREAD IT!\nGet past the first chapter of Silicon Valley. It''s an important foundation to get where McNamee is coming from.\nThen, let the evil begin...\n```", "user": "UGCKJ22GY", "ts": "1572309696.000200", "team": "TGDAJ0S3E", "channel": "DGD8HTE4T", "event_ts": "1572309696.000200", "channel_type": "im"}, "type": "event_callback", "event_id": "EvPHPKJW66", "event_time": 1572309696, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
