INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (773, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "2630fccf-bbed-40e4-8a7f-83e957398ea4", "type": "message", "text": "Recommendations/next steps section is done in draft form. Having read through the conference paper in its current state, there''s something I''d like to clarify about this project as a whole (this might be the source of why things haven''t felt coherent to me lately/why I''ve had intangible, hard-to-pinpoint concerns).\n\na) My understanding of the problem space: we want to design a system to reduce specific preventable burnout-contributing factors (frequent distractions/context switching, pressure to multitask, limited time for focused deep work) using the data we can collect from tech workers'' various digital tools. \"Identifying burnout-prone behavior and making recommendations\" is one specific solution idea, among others including (so far) generated customizable schedules, automatic smart notifications, other designs where the focus is on an active improvement to the workplace/workflow itself.\n\nb) What the problem space sounds like from reading the conference paper: the entire problem space is about how to identify \"burnout-prone behavior\" using API data and burnout models as an alternative to things like employee surveys. Our primary concern is that individual contributors and managers are aware of their own (or team''s) work habits; we aren''t concerned about what they do with that awareness, and our design doesn''t do anything except report.\n\nThese are technically two separate problems (just with a lot of overlap), so which if either (or both) of these is correct? In our previous meetings/discussions, deliverables and research notes it often sounded very much like one or the other, and currently in the conference paper it sounds very much like problem b).", "user": "UJCRT0WJH", "ts": "1572712367.013800", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "Y6j", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "Recommendations/next steps section is done in draft form. Having read through the conference paper in its current state, there''s something I''d like to clarify about this project as a whole (this might be the source of why things haven''t felt coherent to me lately/why I''ve had intangible, hard-to-pinpoint concerns).\n\na) My understanding of the problem space: we want to design a system to reduce specific preventable burnout-contributing factors (frequent distractions/context switching, pressure to multitask, limited time for focused deep work) using the data we can collect from tech workers'' various digital tools. \"Identifying burnout-prone behavior and making recommendations\" is one specific solution idea, among others including (so far) generated customizable schedules, automatic smart notifications, other designs where the focus is on an active improvement to the workplace/workflow itself.\n\nb) What the problem space sounds like from reading the conference paper: the entire problem space is about how to identify \"burnout-prone behavior\" using API data and burnout models as an alternative to things like employee surveys. Our primary concern is that individual contributors and managers are aware of their own (or team''s) work habits; we aren''t concerned about what they do with that awareness, and our design doesn''t do anything except report.\n\nThese are technically two separate problems (just with a lot of overlap), so which if either (or both) of these is correct? In our previous meetings/discussions, deliverables and research notes it often sounded very much like one or the other, and currently in the conference paper it sounds very much like problem b)."}]}]}], "channel": "CPDANB4UV", "event_ts": "1572712367.013800", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvQ37AJQKX", "event_time": 1572712367, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
