INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (784, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "270a1bf7-9c2a-417f-a219-4e54ea8ed19a", "type": "message", "text": "<@UJCRT0WJH> Good thinking.\n\nIt''s about sequencing - we solve b) before a). Our approach is to use the digital footprint from tools of work to understand the individual''s job demands and control over their time.\n\nb): From APIs, can we see they are overworking? How frequently they are interrupted? How much undisturbed time do they have?\n\na): What''s the best way to communicate this? Can we go beyond reporting and actively improve workflow itself?", "user": "UGDBV8GDQ", "ts": "1572717931.034100", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "CNs", "elements": [{"type": "rich_text_section", "elements": [{"type": "user", "user_id": "UJCRT0WJH"}, {"type": "text", "text": " Good thinking.\n\nIt''s about sequencing - we solve b) before a). Our approach is to use the digital footprint from tools of work to understand the individual''s job demands and control over their time.\n\nb): From APIs, can we see they are overworking? How frequently they are interrupted? How much undisturbed time do they have?\n\na): What''s the best way to communicate this? Can we go beyond reporting and actively improve workflow itself?"}]}]}], "channel": "CPDANB4UV", "event_ts": "1572717931.034100", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvPQEE8AJE", "event_time": 1572717931, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
