INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (786, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "ed5c5e5c-c4d2-48ce-b0fa-bd289c983332", "type": "message", "text": "And then time permitting, we might be able to tackle a) using what we learn/obtain from solving b) as well as any other insights or knowledge we''ve obtained over the past few months and the coming ones.", "user": "UJCRT0WJH", "ts": "1572718024.035500", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "sxsb6", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "And then time permitting, we might be able to tackle a) using what we learn/obtain from solving b) as well as any other insights or knowledge we''ve obtained over the past few months and the coming ones."}]}]}], "channel": "CPDANB4UV", "event_ts": "1572718024.035500", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvPQEERU10", "event_time": 1572718024, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
