INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (828, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "c51bf93a-c7b6-4266-be64-921b137054b8", "type": "message", "text": "I think a good place to start is thinking about what our stock is (a few possibilities: energy levels, specific burnout vector(s) in Maslach''s model, or things we want to measure/track like undisturbed time). If I understand the notes, sources/sinks refer to contributors to inflow/outflow of this, where inflow adds to it and outflow takes from it (so not necessarily inputs/outputs of the system, but addition/subtraction from the specific stock). So inflow examples (sources) for undisturbed time might include: free calendar space, ahead-of-schedule task completion, (trying to think of others...) while outflows would be things like notifications (outflow rate controlled by frequency or volume of notifications), meetings, distractions, or tertiary tasks like filling out employee surveys.", "user": "UJCRT0WJH", "ts": "1572724684.045200", "team": "TGDAJ0S3E", "thread_ts": "1572723597.044700", "parent_user_id": "UGDBV8GDQ", "channel": "CPDANB4UV", "event_ts": "1572724684.045200", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvPQFHU7DG", "event_time": 1572724684, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
