INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (908, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "5C972280-6A81-4F59-8626-4EE16C7D5EF6", "type": "message", "text": "<@UJCRT0WJH> how is Github stuff coming?", "user": "UGCKJ22GY", "ts": "1572898601.001100", "team": "TGDAJ0S3E", "channel": "CGD8ER3HR", "event_ts": "1572898601.001100", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvQ52H2KGD", "event_time": 1572898601, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (910, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "f1b3afce-115f-474e-b2fa-6af5480c55e9", "type": "message", "text": "\"The thing that makes it work for me is that when I track \u201cdeep work\u201d I have to consciously think: \u201cthis thing I am going to do now is going to be deep work\u201d. In turn, this is a signal to my brain that I am going to shift gear and that it\u2019s time to get rid of distractions. Intentionality (similar to what happens in meditation) plays a big role here: it feels like \u201ctuning\u201d yourself to a specific mode.\"\n\nThis is a valuable user account for considering how we design our application/UI. Worth thinking about for something I''m about to post.", "user": "UJCRT0WJH", "ts": "1572903992.000100", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "glQQ", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "\"The thing that makes it work for me is that when I track \u201cdeep work\u201d I have to consciously think: \u201cthis thing I am going to do now is going to be deep work\u201d. In turn, this is a signal to my brain that I am going to shift gear and that it\u2019s time to get rid of distractions. Intentionality (similar to what happens in meditation) plays a big role here: it feels like \u201ctuning\u201d yourself to a specific mode.\"\n\nThis is a valuable user account for considering how we design our application/UI. Worth thinking about for something I''m about to post."}]}]}], "thread_ts": "1572404912.000300", "parent_user_id": "UGDBV8GDQ", "channel": "CLMNJJN6M", "event_ts": "1572903992.000100", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvQ56JJ4KF", "event_time": 1572903992, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
