INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (926, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "14fd0a50-2848-4ffa-b90f-9b1ff335a139", "type": "message", "text": "Quick starting point: during Friday''s 461 session, Matt said it would be good if by the panel exam, we''d at least shown something in front of users (these don''t necessarily have to be actual current users - they could be other quick to access representatives such as other SYDE/UW students who have had tech-sector co-ops, potentially having either experienced or witnessed burnout). I think we can get some kind of user input/showcasing done by the end of the week if we put enough time into it (I''m happy to be in the driver''s seat for this; would keep you guys actively in the loop), whereas doing something similar with our more robust/complex/higher-fidelity prototype that is our in-progress application would likely be a lot more time consuming.", "user": "UJCRT0WJH", "ts": "1572904765.003600", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "jWDjN", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "Quick starting point: during Friday''s 461 session, Matt said it would be good if by the panel exam, we''d at least shown something in front of users (these don''t necessarily have to be actual current users - they could be other quick to access representatives such as other SYDE/UW students who have had tech-sector co-ops, potentially having either experienced or witnessed burnout). I think we can get some kind of user input/showcasing done by the end of the week if we put enough time into it (I''m happy to be in the driver''s seat for this; would keep you guys actively in the loop), whereas doing something similar with our more robust/complex/higher-fidelity prototype that is our in-progress application would likely be a lot more time consuming."}]}]}], "thre