ection", "elements": [{"type": "text", "text": "Do some dev magic"}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "Edit Requirements.txt to include the new dependencies before committing"}]}], "style": "bullet", "indent": 0}]}], "channel": "DJEMXU76K", "event_ts": "1572977798.004400", "channel_type": "im"}, "type": "event_callback", "event_id": "EvPTNKUABC", "event_time": 1572977798, "authed_users": ["UGCKJ22GY"]}', NULL);
