INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1169, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "d3a9f2a6-1d1d-44b2-9100-e5006e79c120", "type": "message", "text": "So I can go into my browser and type `<http://something.ngrok.io/slack-install|something.ngrok.io/slack-install>`  then it redirects to the Slack authorization request, then accepting that redirects to `<http://something.ngrok.io/slack-auth-one|something.ngrok.io/slack-auth-one>`  which then authenticates the app (and does a bunch of other shit) which then can redirect anywhere", "user": "UGCKJ22GY", "ts": "1573162463.019100", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "0/f", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "So I can go into my browser and type "}, {"type": "link", "url": "http://something.ngrok.io/slack-install", "text": "something.ngrok.io/slack-install", "style": {"code": true}}, {"type": "text", "text": "  then it redirects to the Slack authorization request, then accepting that redirects to "}, {"type": "link", "url": "http://something.ngrok.io/slack-auth-one", "text": "something.ngrok.io/slack-auth-one", "style": {"code": true}}, {"type": "text", "text": "  which then authenticates the app (and does a bunch of other shit) which then can redirect anywhere"}]}]}], "thread_ts": "1573160529.009600", "parent_user_id": "UJCRT0WJH", "channel": "DJEMXU76K", "event_ts": "1573162463.019100", "channel_type": "im"}, "type": "event_callback", "event_id": "EvQCCU7N4W", "event_time": 1573162463, "authed_users": ["UGCKJ22GY", "UJCRT0WJH"]}', NULL);
