INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1286, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "6e313903-80f2-49f2-8829-dfef0c44d4c7", "type": "message", "text": "Summary from today''s session:\n\n\u2022 Panel exam technical walkthrough: keep it brief, don''t need _too_ many technical details about our app. Save that for the prototype review.\n\u2022 Panel exam is mainly focused on our problem space - eg. defending that it is indeed a problem and our general approach, story so far, plans for iteration/testing/feedback, what goals we have for the project\n\u2022 Need to bring our own laptops to set up presentation. One of the rooms requires installing a piece of software (didn''t catch which room). In either case, might be good to do a tech test beforehand.\n\u2022 Try to \"tell a story\" with PE presentation (don''t overthink this; just general presentation advice)\n\u2022 Can have extra slides beyond the 10-minute presentation to use as reference/illustrations while answering questions (but they still have to be submitted by Sunday).\n\u2022 My general impression is we''re in pretty good shape. If we go in with a plan and a clear understanding we should do fairly well.", "user": "UJCRT0WJH", "ts": "1573230171.006600", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "XSDnS", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "Summary from today''s session:\n"}]}, {"type": "rich_text_list", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "Panel exam technical walkthrough: keep it brief, don''t need "}, {"type": "text", "text": "too", "style": {"italic": true}}, {"type": "text", "text": " many technical details about our app. Save that for the prototype review."}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "Panel exam is mainly focused on our problem space - eg. defending that it is indeed a problem and our general approach, story so far, plans for iteration/testing/feedback, what goals we have for the project"}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "Need to bring our own laptops to set up presentation. One of the rooms requires installing a piece of software (didn''t catch which room). In either case, might be good to do a tech test beforehand."}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "Try to \"tell a story\" with PE presentation (don''t overthink this; just general presentation advice)"}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "Can have extra slides beyond the 10-minute presentation to use as reference/illustrations while answering questions (but they still have to be submitted by Sunday)."}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "My general impression is we''re in pretty good shape. If we go in with a plan and a clear understanding we should do fairly well."}]}], "style": "bullet", "indent": 0}]}], "channel": "CPDANB4UV", "event_ts": "1573230171.006600", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvQBAY949K", "event_time": 1573230171, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ", "UJCRT0WJH"]}', NULL);
