INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1361, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"type": "message", "subtype": "message_changed", "hidden": true, "message": {"client_msg_id": "10ca681a-7c0b-4b53-8a8a-77820ba7a59a", "type": "message", "text": "<https://en.wikipedia.org/wiki/Confucius>", "user": "UGDBV8GDQ", "team": "TGDAJ0S3E", "attachments": [{"image_url": "https://upload.wikimedia.org/wikipedia/commons/thumb/2/29/Kongzi_%28Chinese_characters%29.svg/1200px-Kongzi_%28Chinese_characters%29.svg.png", "image_width": 1200, "image_height": 1348, "image_bytes": 58047, "title": "Confucius", "title_link": "https://en.wikipedia.org/wiki/Confucius", "from_url": "https://en.wikipedia.org/wiki/Confucius", "author_name": "Wikipedia", "author_link": "https://en.wikipedia.org/", "text": "Confucius ( k\u0259n-FEW-sh\u0259s; 551\u2013479 BC) was a Chinese philosopher and politician of the Spring and Autumn period.\nThe philosophy of Confucius, also known as Confucianism, emphasized personal and governmental morality, correctness of social relationships, justice and sincerity. His followers competed successfully with many other schools during the Hundred Schools of Thought era only to be suppressed in favor of the Legalists during the Qin dynasty. Following the victory of Han over Chu after the collapse of Qin, Confucius''s thoughts received official sanction and were further developed into a system known in the West as Neo-Confucianism, and later New Confucianism (Modern Neo-Confucianism).\nConfucius is traditionally credited with having authored or edited many of the Chinese classic texts including all of the Five Classics, but modern scholars are cautious of attributing specific assertions to Confucius himself. Aphorisms concerning his teachings were compiled in the Analects, but only many years after his death.\nConfucius''s principles have commonality with Chinese tradition and belief. He championed strong family loyalty, ancestor veneration, and respect of elders by their children and of husbands by their wives, recommending family as a basis for ideal government. He espoused the well-known principle \"Do not do unto others what you do not want done to yourself\", the Golden Rule. He is also a traditional deity in Daoism.\nConfucius is widely considered as one of the most important and influential individuals in shaping human history. His teaching and philosophy greatly impacted people around the world and remains influential today.", "fallback": "wikipedia: Confucius", "service_icon": "https://a.slack-edge.com/80588/img/unfurl_icons/wikipedia.png", "id": 1, "original_url": "https://en.wikipedia.org/wiki/Confucius"}], "blocks": [{"type": "rich_text", "block_id": "jlVx2", "elements": [{"type": "rich_text_section", "elements": [{"type": "link", "url": "https://en.wikipedia.org/wiki/Confucius"}]}]}], "ts": "1573509652.000200"}, "channel": "DGD8HTE4T", "previous_message": {"client_msg_id": "10ca681a-7c0b-4b53-8a8a-77820ba7a59a", "type": "message", "text": "<https://en.wikipedia.org/wiki/Confucius>", "user": "UGDBV8GDQ", "ts": "1573509652.000200", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "jlVx2", "elements": [{"type": "rich_text_section", "elements": [{"type": "link", "url": "https://en.wikipedia.org/wiki/Confucius"}]}]}]}, "event_ts": "1573509653.000300", "ts": "1573509653.000300", "channel_type": "im"}, "type": "event_callback", "event_id": "EvQDPELLMS", "event_time": 1573509653, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
