INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1371, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "10db8f73-3a7a-4070-b334-dc211b0f14fd", "type": "message", "text": "Part of the interview script introducing problem space:\n\nProblem space intro: tackling burnout in millennial tech workers - around half experience it at work. Burned-out employees are less productive, have less energy, more likely to take a stress/breather leave, and leads to much higher turnover rates. And, of course, being burned out is awful! (I\u2019m sure most of us can relate to that experience, if not from work, then from some busy period in school or life.) Takes a huge toll on mental health.\n\nTrying to design a system to identify and/or help prevent/address burnout-prone work habits - long or unusual hours (eg. weekends, late-night, even if it\u2019s just checking Slack)/excess workload/crunch periods due to poor scheduling/work distribution, lack of focused time (due to distractions or juggling too many tasks). Current techniques (eg. employee surveys, peer feedback) subject to self-reporting biases) - we want a data-driven approach! Using data analysis/insights from tech workplace tools (Slack, Calendar, Git, Jira, etc.) to help individuals and managers be aware of risk factors and have a chance to address them, preventing burnout before it starts!\nPositive effects: Preventing this will tremendously help not only with improving the mental health and job satisfaction of many millions of tech workers, but also make them more energized, productive, and produce high-quality output, which helps organizations meet their goals as well!", "user": "UJCRT0WJH", "ts": "1573604847.000700", "team": "TGDAJ0S3E", "channel": "DJCT71VFA", "event_ts": "1573604847.000700", "channel_type": "im"}, "type": "event_callback", "event_id": "EvQ4JH16TD", "event_time": 1573604847, "authed_users": ["UGDBV8GDQ", "UJCRT0WJH"]}', NULL);
