INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1374, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "0dcc9d1a-40eb-4d42-a098-9110c8b74608", "type": "message", "text": "Likely panel exam question re: Michael Taibi: what did we do/are we doing to test our \"hypothesis\" that digital footprints can be used to identify and track burnout-prone behavior/work patterns? (Tbh calling this a hypothesis still feels weird to me... I know what we mean is that this is our general planned design approach/problem, but it seems hard to test the way you would a hypothesis; I think of things like 362 with \"this beam will have the same strength as that beam\" and other testable, statistical statements. What we have almost sounds more like a HMW question.)", "user": "UJCRT0WJH", "ts": "1573665609.011100", "team": "TGDAJ0S3E", "channel": "CPDANB4UV", "event_ts": "1573665609.011100", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvQKC5UZ9C", "event_time": 1573665609, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ", "UJCRT0WJH"]}', NULL);
