INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1376, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "ba6e8f54-1e3d-4170-8848-fc8808da84c7", "type": "message", "text": "Would this be something like \"Testing with real data sources and known habits (like our Slack channel data) to verify accuracy\"?", "user": "UJCRT0WJH", "ts": "1573666838.011700", "team": "TGDAJ0S3E", "thread_ts": "1573665609.011100", "parent_user_id": "UJCRT0WJH", "channel": "CPDANB4UV", "event_ts": "1573666838.011700", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvQGNTJF8U", "event_time": 1573666838, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ", "UJCRT0WJH"]}', NULL);
