INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1427, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "f769e0ba-362a-459f-b3c7-9c3d37e334e6", "type": "message", "text": "\n\nCouple of updates from the last several days:\n\n\u2022 Had one last user interview last Friday (was already scheduled, was just going to be a formality  but reworked the script based on panel exam/scope feedback, and got some nice insight into the problems with employee wellness surveys (and why an automated data-driven system would be so valuable), plus some considerations for data privacy and for what someone might do to try and \"fool\" our system.\n\u2022 Brainstormed a bunch of analysis methods + example scenarios for GitHub. Gives us some direction if we include GitHub in our scope, and might be a useful reference when discussing our project scope with Matt\n\n\nSpeaking of, any preferred dates for our scope discussion and final prototype review?", "user": "UJCRT0WJH", "ts": "1574126996.001600", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "fFrM", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "\n\nCouple of updates from the last several days:\n"}]}, {"type": "rich_text_list", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "Had one last user interview last Friday (was already scheduled, was just going to be a formality  but reworked the script based on panel exam/scope feedback, and got some nice insight into the problems with employee wellness surveys (and why an automated data-driven system would be so valuable), plus some considerations for data privacy and for what someone might do to try and \"fool\" our system."}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "Brainstormed a bunch of analysis methods + example scenarios for GitHub. Gives us some direction if we include GitHub in our scope, and might be a useful reference when discussing our project scope with Matt"}]}], "style": "bullet", "indent": 0}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "\n\nSpeaking of, any preferred dates for our scope discussion and final prototype review?"}]}]}], "channel": "CPDANB4UV", "event_ts": "1574126996.001600", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvQRTK6URL", "event_time": 1574126996, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ", "UJCRT0WJH"]}', NULL);
