INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1480, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "0bd1e0d1-1ee3-4d8d-8ed6-479f4a5bd86e", "type": "message", "text": "So tonight I''m working on getting something displaying for GitHub for the prototype review... but I''m unclear on what exactly we may want to display. First, out of curiosity, what are you planning to display with Slack, and what is the purpose of it in the context of 461? Second, what sort of thing would we want to display for GitHub to compliment this and/or whatever Kush is doing with the calendar API data? I feel like I don''t have a clear goal in mind and want to set that straight so I can make quick progress towards it.\nWe''ve talked about commits/pull requests - how would something like a measure of productivity be based on a user''s pull requests and/or number of commits within it and/or number of additions and deletions (in lines of code) and/or number of files changed?", "user": "UJCRT0WJH", "ts": "1574552098.000400", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "qO0L", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "So tonight I''m working on getting something displaying for GitHub for the prototype review... but I''m unclear on what exactly we may want to display. First, out of curiosity, what are you planning to display with Slack, and what is the purpose of it in the context of 461? Second, what sort of thing would we want to display for GitHub to compliment this and/or whatever Kush is doing with the calendar API data? I feel like I don''t have a clear goal in mind and want to set that straight so I can make quick progress towards it.\nWe''ve talked about commits/pull requests - how would something like a measure of productivity be based on a user''s pull requests and/or number of commits within it and/or number of additions and deletions (in lines of code) and/or number of files changed?"}]}]}], "channel": "DJEMXU37H", "event_ts": "1574552098.000400", "channel_type": "im"}, "type": "event_callback", "event_id": "EvQKD6B1BM", "event_time": 1574552098, "authed_users": ["UJCRT0WJH"]}', NULL);
INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1479, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "7ec365c6-dab6-4f54-9fec-c8e00c87be09", "type": "message", "text": "Here''s one semi-involved idea I''ve had: take a pull request, find out how long it was since the last pull request, and for that time period, use some kind of basic formula based on the mean time per commit, changed lines per commit/pull request, and number of files changed per commit/pull request - this would give us an estimate of someone''s productivity. We could later extend this with things like tracking changes or fluctuations in the productivity estimates over time (both short-term, showing more or less productive days, or long-term, suggesting overall improvements or decreases), or by comparing the total changed lines/files in a commit", "user": "UJCRT0WJH", "ts": "1574552071.000200", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "4Kj", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "Here''s one semi-involved idea I''ve had: take a pull request, find out how long it was since the last pull request, and for that time period, use some kind of basic formula based on the mean time per commit, changed lines per commit/pull request, and number of files changed per commit/pull request - this would give us an estimate of someone''s productivity. We could later extend this with things like tracking changes or fluctuations in the productivity estimates over time (both short-term, showing more or less productive days, or long-term, suggesting overall improvements or decreases), or by comparing the total changed lines/files in a commit"}]}]}], "channel": "DJEMXU37H", "event_ts": "1574552071.000200", "channel_type": "im"}, "type": "event_callback", "event_id": "EvQKD67JAX", "event_time": 1574552071, "authed_users": ["UJCRT0WJH"]}', NULL);
