ub for the prototype review... but I''m unclear on what exactly we may want to display. First, out of curiosity, what are you planning to display with Slack, and what is the purpose of it in the context of 461? Second, what sort of thing would we want to display for GitHub to compliment this and/or whatever Kush is doing with the calendar API data? I feel like I don''t have a clear goal in mind and want to set that straight so I can make quick progress towards it.\nWe''ve talked about commits/pull requests - how would something like a measure of productivity be based on a user''s pull requests and/or number of commits within it and/or number of additions and deletions (in lines of code) and/or number of files changed?\nHere''s one semi-involved idea I''ve had: take a pull request, find out how long it was since the last pull request, and for that time period, use some kind of basic formula based on the mean time per commit, changed lines per commit/pull request, and number of files changed per commit/pull request - this would give us an estimate of someone''s productivity. We could later extend this with things like tracking changes or fluctuations in the productivity estimates over time (both short-term, showing more or less productive days, or long-term, suggesting overall improvements or decreases), or by comparing the total changed lines/files in a commit"}]}]}], "channel": "GQWDGLFV2", "event_ts": "1574552139.000300", "channel_type": "mpim"}, "type": "event_callback", "event_id": "EvQJ3XM0TC", "event_time": 1574552139, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ", "UJCRT0WJH"]}', NULL);
