INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1485, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"type": "message", "subtype": "message_changed", "hidden": true, "message": {"client_msg_id": "2db8fe87-2d26-4f9e-b60f-c82658d1fcad", "type": "message", "text": "Hey guys! So tonight I''m working on getting something displaying for GitHub for the prototype review... but I''m unclear on what exactly we may want to display. First, out of curiosity, what are you planning to display with Slack, and what is the purpose of it in the context of 461? Second, what sort of thing would we want to display for GitHub to compliment this and/or whatever Kush is doing with the calendar API data? I feel like I don''t have a clear goal in mind and want to set that straight so I can make quick progress towards it.\nWe''ve talked about commits/pull requests - how would something like a measure of productivity be based on a user''s pull requests and/or number of commits within it and/or number of additions and deletions (in lines of code) and/or number of files changed?\nA few semi-involved ideas I''ve had: take a pull request, find out how long it was since the last pull request, and for that time period, use some kind of basic formula based on the mean time per commit, changed lines per commit/pull request, and number of files changed per commit/pull request - this would give us an estimate of someone''s productivity. We could later extend this with things like tracking changes or fluctuations in the productivity estimates over time (both short-term, showing more or less productive days, or long-term, suggesting overall improvements or decreases), or by seeing if there''s a difference in lines changed for a pull request vs aggregate total within its commits, suggesting indecisveness or scrapped work.", "user": "UJCRT0WJH", "team": "TGDAJ0S3E", "edited": {"user": "UJCRT0WJH", "ts": "1574552188.000000"}, "bloc