INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1498, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"type": "message", "text": "The care and feeding of software engineers (or, why engineers are grumpy) - Human Who Codes\n<https://humanwhocodes.com/blog/2012/06/12/the-care-and-feeding-of-software-engineers-or-why-engineers-are-grumpy/>\n\n_The enemy of any creator is context switching. Once you get into a deeply creative mode, \u201cthe flow\u201d as some call it, being disturbed to shift focus to something else completely interrupts the process. Yes, writing code is a creative process. It\u2019s both logical and creative at the same time. We aren\u2019t simply writing code, we are crafting it._\n\n", "user": "UGCKJ22GY", "ts": "1574582399.000100", "team": "TGDAJ0S3E", "channel": "CGDAJ1K1A", "event_ts": "1574582399.000100", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvQYSP5Y4F", "event_time": 1574582399, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ", "UJCRT0WJH"]}', NULL);
