INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1521, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "ebcca7d6-fc18-4193-98c1-0e093f29f8cd", "type": "message", "text": "^ this was super refreshing to read. So relevant for our project. Many parts stood out, especially:\n\n\n&gt; Make sure that your engineers have, every single day, at least four hours of uninterrupted time to code. That\u2019s the key to getting work done faster. It seems fairly logical: if people usually work an eight hour day, at least half of the time should be spent on the main task. I used to find that I was most productive between 1 PM and 5 PM. I knew that if I had that time every day I could easily complete my tasks. When that time started to be interrupted by meetings, I knew I wouldn\u2019t get as much done.\n&gt; \n&gt; Also, take at least one day a week to have no meetings. That includes daily standups. Just let the engineers have that single day to completely manage their time on their own and get everything done. It is absolutely amazing how much can get accomplished when an entire day is free of interruptions. If necessary, allows engineers to work from home to make sure that they\u2019re not interrupted.\"", "user": "UGDBV8GDQ", "ts": "1574635825.002100", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "R20ke", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "^ this was super refreshing to read. So relevant for our project. Many parts stood out, especially:\n\n"}]}, {"type": "rich_text_quote", "elements": [{"type": "text", "text": "Make sure that your engineers have, every single day, at least four hours of uninterrupted time to code. That\u2019s the key to getting work done faster. It seems fairly logical: if people usually work an eight hour day, at least half of the time should be spent on the main task. I used to find that I was most productive between 1 PM and 5 PM. I knew that if I had that time every day I could easily complete my tasks. When that time started to be interrupted by meetings, I knew I wouldn\u2019t get as much done.\n\nAlso, take at least one day a week to have no meetings. That includes daily standups. Just let the engineers have that single day to completely manage their time on their own and get everything done. It is absolutely amazing how much can get accomplished when an entire day is free of interruptions. If necessary, allows engineers to work from home to make sure that they\u2019re not interrupted.\""}]}]}], "channel": "CGDAJ1K1A", "event_ts": "1574635825.002100", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvQWSEBNE8", "event_time": 1574635825, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ", "UJCRT0WJH"]}', NULL);
