INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1656, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"type": "message", "subtype": "message_changed", "hidden": true, "message": {"client_msg_id": "0b42c8bd-a30c-427c-aaba-f6c7ea60e987", "type": "message", "text": "I have something set up that should be able to print out the dates and times of all of a users commits (currently sorted by repository then date but we could rework it to sort first by date if desired. However, when testing it locally, when trying to access a user''s repositories:\n\n```  for repo in gitUser.get_repos():```\nI''m getting a badCredentialsException, which is caused when a 401 or 403 status (401 in my case) is thrown. This seems to be the result of insufficient/improper authentication (saw an example where it was due to an improper OAuth token - <https://stackoverflow.com/questions/25196774/pygithub-badcredentialsexception-when-calling-github-get-organization>). I can confirm that an OAuth token is being used but it''s from the first user added to the database with the name \"Callum\", whereas I reauthenticated a few times since then which (due to a temporary misstep in how I handled re-authentication) would have created a new token and presumably made the old one invalid... correct?", "user": "UJCRT0WJH", "team": "TGDAJ0S3E", "attachments": [{"service_name": "Stack Overflow", "title": "PyGithub BadCredentialsException when calling Github.get_organization()", "title_link": "https://stackoverflow.com/questions/25196774/pygithub-badcredentialsexception-when-calling-github-get-organization", "text": "I''m using PyGithub v1.25 to create a little webapp where members of my organization can create private repositories in our github organization. Right now, I''m getting a BadCredentialsException when", "fallback": "Stack Overflow: PyGithub BadCredentialsException when calling Github.get_organization()", "thumb_url": "https://cdn.sstatic.net/Sites/stackoverflow/img/apple-touch-icon@2.png?v=73d79a89bded", "from_url": "https://stackoverflow.com/questions/25196774/pygithub-badcredentialsexception-when-calling-github-get-organization", "thumb_width": 316, "thumb_height": 316, "service_icon": "https://cdn.sstatic.net/Sites/stackoverflow/img/favicon.ico?v=4f32ecc8f43d", "id": 1, "original_url": "https://stackoverflow.com/questions/25196774/pygithub-badcredentialsexception-when-calling-github-get-organization"}], "blocks": [{"type": "rich_text", "block_id": "Ggtw", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "I have something set up that should be able to print out the dates and times of all of a users commits (currently sorted by repository then date but we could rework it to sort first by date if desired. However, when testing it locally, when trying to access a user''s repositories:\n"}]}, {"type": "rich_text_preformatted", "elements": [{"type": "text", "text": "  for repo in gitUser.get_repos():"}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "I''m getting a badCredentialsException, which is caused when a 401 or 403 status (401 in my case) is thrown. This seems to be the result of insufficient/improper authentication (saw an example where it was due to an improper OAuth token - "}, {"type": "link", "url": "https://stackoverflow.com/questions/25196774/pygithub-badcredentialsexception-when-calling-github-get-organization"}, {"type": "text", "text": "). I can confirm that an OAuth token is being used but it''s from the first user added to the database with the name \"Callum\", whereas I reauthenticated a few times since then which (due to a temporary misstep in how I handled re-authentication) would have created a new token and presumably made the old one invalid... correct?"}]}]}], "ts": "1574734045.028600"}, "channel": "DJEMXU76K", "previous_message": {"client_msg_id": "0b42c8bd-a30c-427c-aaba-f6c7ea60e987", "type": "message", "text": "I have something set up that should be able to print out the dates and times of all of a users commits (currently sorted by repository then date but we could rework it to sort first by date if desired. However, when testing it locally, when trying to access a user''s repositories:\n\n```  for repo in gitUser.get_repos():```\nI''m getting a badCredentialsException, which is caused when a 401 or 403 status (401 in my case) is thrown. This seems to be the result of insufficient/improper authentication (saw an example where it was due to an improper OAuth token - <https://stackoverflow.com/questions/25196774/pygithub-badcredentialsexception-when-calling-github-get-organization>). I can confirm that an OAuth token is being used but it''s from the first user added to the database with the name \"Callum\", whereas I reauthenticated a few times since then which (due to a temporary misstep in how I handled re-authentication) would have created a new token and presumably made the old one invalid... correct?", "user": "UJCRT0WJH", "ts": "1574734045.028600", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "Ggtw", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "I have something set up that should be able to print out the dates and times of all of a users commits (currently sorted by repository then date but we could rework it to sort first by date if desired. However, when testing it locally, when trying to access a user''s repositories:\n"}]}, {"type": "rich_text_preformatted", "elements": [{"type": "text", "text": "  for repo in gitUser.get_repos():"}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "I''m getting a badCredentialsException, which is caused when a 401 or 403 status (401 in my case) is thrown. This seems to be the result of insufficient/improper authentication (saw an example where it was due to an improper OAuth token - "}, {"type": "link", "url": "https://stackoverflow.com/questions/25196774/pygithub-badcredentialsexception-when-calling-github-get-organization"}, {"type": "text", "text": "). I can confirm that an OAuth token is being used but it''s from the first user added to the database with the name \"Callum\", whereas I reauthenticated a few times since then which (due to a temporary misstep in how I handled re-authentication) would have created a new token and presumably made the old one invalid... correct?"}]}]}]}, "event_ts": "1574734046.028700", "ts": "1574734046.028700", "channel_type": "im"}, "type": "event_callback", "event_id": "EvQR4WBZG9", "event_time": 1574734046, "authed_users": ["UGCKJ22GY", "UJCRT0WJH"]}', NULL);
