INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1499, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"type": "message", "subtype": "message_changed", "hidden": true, "message": {"type": "message", "text": "The care and feeding of software engineers (or, why engineers are grumpy) - Human Who Codes\n<https://humanwhocodes.com/blog/2012/06/12/the-care-and-feeding-of-software-engineers-or-why-engineers-are-grumpy/>\n\n_The enemy of any creator is context switching. Once you get into a deeply creative mode, \u201cthe flow\u201d as some call it, being disturbed to shift focus to something else completely interrupts the process. Yes, writing code is a creative process. It\u2019s both logical and creative at the same time. We aren\u2019t simply writing code, we are crafting it._\n\n", "user": "UGCKJ22GY", "team": "TGDAJ0S3E", "attachments": [{"title": "The care and feeding of software engineers (or, why engineers are grumpy)", "title_link": "https://humanwhocodes.com/blog/2012/06/12/the-care-and-feeding-of-software-engineers-or-why-engineers-are-grumpy/", "text": "Not too long ago, Jenna Bilotta wrote an excellent article called, How designers and engineers can play nice1, in which she talks about ways for designers and engineers to work more productively. Having...", "fallback": "The care and feeding of software engineers (or, why engineers are grumpy)", "thumb_url": "https://humanwhocodes.com/images/favicon.png", "from_url": "https://humanwhocodes.com/blog/2012/06/12/the-care-and-feeding-of-software-engineers-or-why-engineers-are-grumpy/", "thumb_width": 96, "thumb_height": 96, "service_icon": "https://humanwhocodes.com/images/favicon.png", "service_name": "humanwhocodes.com", "id": 1, "original_url": "https://humanwhocodes.com/blog/2012/06/12/the-care-and-feeding-of-software-engineers-or-why-engineers-are-grumpy/"}], "ts": "1574582399.000100"}, "channel": "CGDAJ1K1A", "previous_message": {"type": "message", "text": "The care and feeding of software engineers (or, why engineers are grumpy) - Human Who Codes\n<https://humanwhocodes.com/blog/2012/06/12/the-care-and-feeding-of-software-engineers-or-why-engineers-are-grumpy/>\n\n_The enemy of any creator is context switching. Once you get into a deeply creative mode, \u201cthe flow\u201d as some call it, being disturbed to shift focus to something else completely interrupts the process. Yes, writing code is a creative process. It\u2019s both logical and creative at the same time. We aren\u2019t simply writing code, we are crafting it._\n\n", "user": "UGCKJ22GY", "ts": "1574582399.000100", "team": "TGDAJ0S3E"}, "event_ts": "1574582400.000200", "ts": "1574582400.000200", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvQX1EK1H6", "event_time": 1574582400, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ", "UJCRT0WJH"]}', NULL);
