INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1931, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "B7185F52-E21A-420C-8F0E-2FE30735AEDC", "type": "message", "text": "\u201cWe\u2019re super proud of these kids as we always are of our graduates,\u201d Loney said. \u201cThese kids will, without question, change the world.\u201d", "user": "UGDBV8GDQ", "ts": "1575322908.024400", "team": "TGDAJ0S3E", "channel": "DGD8HTE4T", "event_ts": "1575322908.024400", "channel_type": "im"}, "type": "event_callback", "event_id": "EvR6BEGQ6Q", "event_time": 1575322908, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
