INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1938, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "be472213-ef03-49c2-88d2-96abcb637878", "type": "message", "text": "I will assist in any work which _can_ or _need_ be accelerated", "user": "UGCKJ22GY", "ts": "1575323316.028300", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "+gnT", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "I will assist in any work which "}, {"type": "text", "text": "can", "style": {"italic": true}}, {"type": "text", "text": " or "}, {"type": "text", "text": "need", "style": {"italic": true}}, {"type": "text", "text": " be accelerated"}]}]}], "channel": "DGD8HTE4T", "event_ts": "1575323316.028300", "channel_type": "im"}, "type": "event_callback", "event_id": "EvQYT43B6V", "event_time": 1575323316, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (1939, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "c11bad05-d9fb-4f03-b47a-36beb92f1392", "type": "message", "text": "&gt; *What aspects of the project have gone poorly, and what were the major causes for the issues?*\n&gt; \n&gt;  The poorest part of the project thus far is team cohesiveness during externally facing meetings with stakeholders. Often, one team member will present unpracticed material, answer questions using answers which other group members do not agree with / have never been discussed, or discuss not being aligned about issues upon which they have been previously briefed. \n&gt;  \n&gt;  The team is learning to reflect and discuss these events more openly, and surface them as a pattern to one another. As well, it is learning to adapt to the work styles of the different team members to better enable them to do their best work. As mentioned above, this team has never worked together before on a design project.", "user": "UGCKJ22GY", "ts": "1575323431.029100", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "ziVAR", "elements": [{"type": "rich_text_quote", "elements": [{"type": "text", "text": "What aspects of the project have gone poorly, and what were the major causes for the issues?", "style": {"bold": true}}, {"type": "text", "text": "\n\n The poorest part of the project thus far is team cohesiveness during externally facing meetings with stakeholders. Often, one team member will present unpracticed material, answer questions using answers which other group members do not agree with / have never been discussed, or discuss not being aligned about issues upon which they have been previously briefed. \n \n The team is learning to reflect and discuss these events more openly, and surface them as a pattern to one another. As well, it is learning to adapt to the work styles of the different team members to better enable them to do their best work. As mentioned above, this team has never worked together before on a design project."}]}]}], "channel": "DGD8HTE4T", "event_ts": "1575323431.029100", "channel_type": "im"}, "type": "event_callback", "event_id": "EvQU271QLS", "event_time": 1575323431, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
