INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (2231, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "662db6cd-88d4-462c-be9d-565ffacfa6f8", "type": "message", "text": "So Peter Senge is a well-known complex systems person that applies the theory to organizations.\n\nHis book is Fifth Discipline <https://en.wikipedia.org/wiki/The_Fifth_Discipline>\nList of characteristics that learning organizations share here <https://en.wikipedia.org/wiki/Learning_organization>\n\nWonder how we can apply these to our designs for deep work assistant, specific to an organizational context?", "user": "UGDBV8GDQ", "ts": "1575930149.002100", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "fDKnr", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "So Peter Senge is a well-known complex systems person that applies the theory to organizations.\n\nHis book is Fifth Discipline "}, {"type": "link", "url": "https://en.wikipedia.org/wiki/The_Fifth_Discipline"}, {"type": "text", "text": "\nList of characteristics that learning organizations share here "}, {"type": "link", "url": "https://en.wikipedia.org/wiki/Learning_organization"}, {"type": "text", "text": "\n\nWonder how we can apply these to our designs for deep work assistant, specific to an organizational context?"}]}]}], "channel": "CLMNJJN6M", "event_ts": "1575930149.002100", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvRG8HN0DT", "event_time": 1575930149, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ", "UPHM989GB", "UJCRT0WJH"]}', NULL);
