from_url": "https://en.wikipedia.org/wiki/Learning_organization", "author_name": "Wikipedia", "author_link": "https://en.wikipedia.org/", "text": "In business management, a learning organization is a company that facilitates the learning of its members and continuously transforms itself. The concept was coined through the work and research of Peter Senge and his colleagues.Learning organizations develop as a result of the pressures facing modern organizations; this enables them to remain competitive in the business environment.", "fallback": "wikipedia: Learning organization", "service_icon": "https://a.slack-edge.com/80588/img/unfurl_icons/wikipedia.png", "id": 2, "original_url": "https://en.wikipedia.org/wiki/Learning_organization"}], "blocks": [{"type": "rich_text", "block_id": "fDKnr", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "So Peter Senge is a well-known complex systems person that applies the theory to organizations.\n\nHis book is Fifth Discipline "}, {"type": "link", "url": "https://en.wikipedia.org/wiki/The_Fifth_Discipline"}, {"type": "text", "text": "\nList of characteristics that learning organizations share here "}, {"type": "link", "url": "https://en.wikipedia.org/wiki/Learning_organization"}, {"type": "text", "text": "\n\nWonder how we can apply these to our designs for deep work assistant, specific to an organizational context?"}]}]}], "ts": "1575930149.002100"}, "channel": "CLMNJJN6M", "previous_message": {"client_msg_id": "662db6cd-88d4-462c-be9d-565ffacfa6f8", "type": "message", "text": "So Peter Senge is a well-known complex systems person that applies the theory to organizations.\n\nHis book is Fifth Discipline <https://en.wikipedia.org/wiki/The_Fifth_Discipline>\nList of characteristics that learning organizations share here <https://en.wikipedia.org/wiki/Learning_organization>\n\nWonder how we can apply these to our designs for deep work assistant, specific to an organizational context?", "user": "UGDB