INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (2319, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "45e075e8-e160-449b-8639-6e4f459ff63b", "type": "message", "text": "Like, what does this do in Maestro.vue\n\n```&lt;script&gt;\n  import { fetchUser } from ''@/api''\n  export default {\n    data() {\n      return {maestro: null}\n    },\n    beforeMount() {\n      console.log(''Survey.beforeMount -&gt; :id === '', this.$route.params.id)\n      var userId = parseInt(this.$route.params.id)\n      fetchUser(userId).then(response =&gt; {\n        this.maestro = response\n      })\n      \n    }\n  }\n&lt;/script&gt;```", "user": "UGDBV8GDQ", "ts": "1576353392.001100", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "sd6", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "Like, what does this do in Maestro.vue\n\n"}]}, {"type": "rich_text_preformatted", "elements": [{"type": "text", "text": "<script>\n  import { fetchUser } from ''@/api''\n  export default {\n    data() {\n      return {maestro: null}\n    },\n    beforeMount() {\n      console.log(''Survey.beforeMount -> :id === '', this.$route.params.id)\n      var userId = parseInt(this.$route.params.id)\n      fetchUser(userId).then(response => {\n        this.maestro = response\n      })\n      \n    }\n  }\n</script>"}]}]}], "channel": "DGD8HTE4T", "event_ts": "1576353392.001100", "channel_type": "im"}, "type": "event_callback", "event_id": "EvRDKTSXH7", "event_time": 1576353392, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
