INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (2528, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "fdfda330-bf78-400b-9179-23e540ec8181", "type": "message", "text": "Why not relate calendarevents to user?", "user": "UGDBV8GDQ", "ts": "1576461335.006900", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "B=j5", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "Why not relate calendarevents to user?"}]}]}], "channel": "DGD8HTE4T", "event_ts": "1576461335.006900", "channel_type": "im"}, "type": "event_callback", "event_id": "EvRQFY0L13", "event_time": 1576461335, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (2529, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "45b68e15-a270-4ca3-b6b7-1be700822502", "type": "message", "text": "Also, have you ever handled non-builtin exceptions before?", "user": "UGDBV8GDQ", "ts": "1576461404.008900", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "+L2", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "Also, have you ever handled non-builtin exceptions before?"}]}]}], "channel": "DGD8HTE4T", "event_ts": "1576461404.008900", "channel_type": "im"}, "type": "event_callback", "event_id": "EvRSBK61DM", "event_time": 1576461404, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (2530, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "976f0b93-ba05-4cb3-9474-cf9a888de82c", "type": "message", "text": "&gt;  Why not relate calendarevents to user?\n1. We don\u2019t need to, and it is another thing to set / maintain to be true. Hypothetical: you want to assign a calendar to a different user, then you can just point the calendar user at it. BUT if all the calendar events are pointed at the user, you then have to edit all of those as well", "user": "UGCKJ22GY", "ts": "1576461475.010500", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "ur8y", "elements": [{"type": "rich_text_quote", "elements": [{"type": "text", "text": " Why not relate calendarevents to user?"}]}, {"type": "rich_text_list", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "We don\u2019t need to, and it is another thing to set / maintain to be true. Hypothetical: you want to assign a calendar to a different user, then you can just point the calendar user at it. BUT if all the calendar events are pointed at the user, you then have to edit all of those as well"}]}], "style": "ordered", "indent": 0}]}], "channel": "DGD8HTE4T", "event_ts": "1576461475.010500", "channel_type": "im"}, "type": "event_callback", "event_id": "EvRSBKQQQP", "event_time": 1576461475, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (2531, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "5ebf4d45-e56b-41fd-a57b-c0a09ec6e24e", "type": "message", "text": "I get bad smells when we have unnecessary foreign keys", "user": "UGCKJ22GY", "ts": "1576461494.010900", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "nNo", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "I get bad smells when we have unnecessary foreign keys"}]}]}], "channel": "DGD8HTE4T", "event_ts": "1576461494.010900", "channel_type": "im"}, "type": "event_callback", "event_id": "EvRE7X285P", "event_time": 1576461494, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (2532, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "77ec40f6-ae57-4bf6-8cda-88cb7692c131", "type": "message", "text": "And since it is all primary keys anyway, it is not making things any faster", "user": "UGCKJ22GY", "ts": "1576461505.011300", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "A6tPr", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "And since it is all primary keys anyway, it is not making things any faster"}]}]}], "channel": "DGD8HTE4T", "event_ts": "1576461505.011300", "channel_type": "im"}, "type": "event_callback", "event_id": "EvRSBL2U79", "event_time": 1576461505, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
