INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (2603, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"type": "message", "subtype": "message_changed", "hidden": true, "message": {"client_msg_id": "915F69E8-A8E4-4FAD-8EA8-0AB634048EC5", "type": "message", "text": "<https://dcgross.com/be-lazy/>\nLet\u2019s keep this at top of mind", "user": "UGCKJ22GY", "team": "TGDAJ0S3E", "attachments": [{"service_name": "Daniel Gross", "title": "Be Lazy - Daniel Gross", "title_link": "https://dcgross.com/be-lazy/", "text": "Coding is fun. Really fun. Having played other actors in the startup play (manager, investor, twitter user, coffee consumer, etc) I can tell you that coding is the best flow you\u2019ll get. It\u2019s uniquely great.\u00a0 So it isn\u2019t surprising to learn that technical founders over-engineer things. Why solve something manually if you can write a \u2026 Continue reading Be Lazy", "fallback": "Daniel Gross: Be Lazy - Daniel Gross", "image_url": "https://dcgross.com/wp-content/uploads/2019/11/tw1.png", "ts": 1573232536, "from_url": "https://dcgross.com/be-lazy/", "image_width": 500, "image_height": 250, "image_bytes": 159931, "service_icon": "https://dcgross.com/wp-content/uploads/2018/03/cropped-favicon-180x180.png", "id": 1, "original_url": "https://dcgross.com/be-lazy/"}], "ts": "1576514337.000300"}, "channel": "CGD8ER3HR", "previous_message": {"client_msg_id": "915F69E8-A8E4-4FAD-8EA8-0AB634048EC5", "type": "message", "text": "<https://dcgross.com/be-lazy/>\nLet\u2019s keep this at top of mind", "user": "UGCKJ22GY", "ts": "1576514337.000300", "team": "TGDAJ0S3E"}, "event_ts": "1576514339.000400", "ts": "1576514339.000400", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvRRDUHXGV", "event_time": 1576514339, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ", "UPHM989GB", "UJCRT0WJH"]}', NULL);
INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (2604, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "2440B787-EC3F-45C5-B2F1-F34A55D36533", "type": "message", "text": "We are progressing towards finishing a prototype, and there is product validation with competitors\nBut\n&gt; For example, suppose you\u2019re trying to figure out if there\u2019s a market for your enterprise product. I wouldn\u2019t write a line of code. I\u2019d start with sending an email to a few users with an animated GIF of a prototype. You can do that in an hour. Then you might try and onboard them manually.", "user": "UGCKJ22GY", "ts": "1576514415.001300", "team": "TGDAJ0S3E", "thread_ts": "1576514337.000300", "parent_user_id": "UGCKJ22GY", "channel": "CGD8ER3HR", "event_ts": "1576514415.001300", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvRF5W8Y9X", "event_time": 1576514415, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ", "UPHM989GB", "UJCRT0WJH"]}', NULL);
