INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (2688, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"type": "message", "subtype": "message_changed", "hidden": true, "message": {"type": "message", "text": "<@UGCKJ22GY> <@UJCRT0WJH> so our MVP is to visualize a user''s available time for deep work in the upcoming week and deduct that time dynamically based on Calendar events and Slack reads.\n\nAs such, we need to determine the algorithms/policies for _how_ we deduct that time. For example, there''s the figure that it takes 23 mins for a knowledge worker to recover from an interruption (search: Gloria Mark). There''s also lots of CogErg/Human Factors stuff about task switching and the cognitive/time cost. One simple proposal from exploring some preliminary Slack data (linked below), perhaps an initial rule is after *3 consecutive reads*, we deduct *23 mins*?\n\nGetting the MVP to a done state is the priority, but it''d be good if we can consider some justifiable, science-based approaches/alternatives here. The user has to trust when we tell them they''re interrupted. Ideas on this?\n\n<https://docs.google.com/spreadsheets/d/1OLGIVwU0vwfj8BVOeRw8L0LB4CitsS2AnhiMLjCbsy4/edit?usp=sharing>", "files": [{"id": "FRG1J04AV", "created": 1576552885, "timestamp": 1576552885, "name": "slack_reads", "title": "slack_reads", "mimetype": "application/vnd.google-apps.spreadsheet", "filetype": "gsheet", "pretty_type": "GSuite Spreadsheet", "user": "UGDBV8GDQ", "editable": false, "size": 600150, "mode": "external", "is_external": true, "external_type": "gdrive", "is_public": true, "public_url_shared": false, "display_as_bot": false, "username": "", "url_private": "https://docs.google.com/spreadsheets/d/1OLGIVwU0vwfj8BVOeRw8L0LB4CitsS2AnhiMLjCbsy4/edit?usp=sharing", "thumb_pdf": "https://files.slack.com/files-tmb/TGDAJ0S3E-FRG1J04AV-158bdbde50/slack_reads_thumb_pdf.png", "thumb_pdf_w": 935, "thumb_pdf_h": 121