INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (2646, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "b28b8f55-18cf-456b-b4af-1295d8dc8993", "type": "message", "text": "So SOP for this kind of stuff where you need to build in new database constraints (I spent my whole first term at Shopify doing this kind of stuff)\n1. Set up column without constraint\n2. Build in software constraint to not allow any new rows to be created without meeting constraint\n3. run software job to update all rows to meet constraint (`created_at` is one which should always be added when the table is created)\n4. put in database level constraint\n", "user": "UGCKJ22GY", "ts": "1576518987.021100", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "XstPW", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "So SOP for this kind of stuff where you need to build in new database constraints (I spent my whole first term at Shopify doing this kind of stuff)\n"}]}, {"type": "rich_text_list", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "Set up column without constraint"}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "Build in software constraint to not allow any new rows to be created without meeting constraint"}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "run software job to update all rows to meet constraint ("}, {"type": "text", "text": "created_at", "style": {"code": true}}, {"type": "text", "text": " is one which should always be added when the table is created)"}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "put in database level constraint"}]}], "style": "ordered", "indent": 0}, {"type": "rich_text_section", "elements": []}]}], "channel": "DGD8HTE4T", "event_ts": "1576518987.021100", "channel_type": "im"}, "type": "event_callback", "event_id": "EvRR46NNGL", "event_time": 1576518987, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
