 from an interruption (search: Gloria Mark). There''s also lots of CogErg/Human Factors stuff about task switching and the cognitive/time cost. One proposal form exploring some preliminary Slack data (linked below), perhaps an initial rule is after "}, {"type": "text", "text": "3 consecutive reads", "style": {"bold": true}}, {"type": "text", "text": ", we deduct "}, {"type": "text", "text": "23 mins", "style": {"bold": true}}, {"type": "text", "text": "?\n\nGetting the MVP to a done state is the priority, but it''d be good if we can consider some justifiable, science-based approaches/alternatives here. The user has to trust when we tell them they''re interrupted. Ideas on this?\n\n"}, {"type": "link", "url": "https://docs.google.com/spreadsheets/d/1OLGIVwU0vwfj8BVOeRw8L0LB4CitsS2AnhiMLjCbsy4/edit?usp=sharing"}]}]}], "channel": "CGDAJ1K1A", "event_ts": "1576554497.012900", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvRG22KYUR", "event_time": 1576554497, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ", "UPHM989GB", "UJCRT0WJH"]}', NULL);
