INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (2710, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "56a6dbc2-b883-4e7b-852b-efa294b4c622", "type": "message", "text": "```ECON 212 LEC 0.50\tCourse ID: 015181\nIntroduction to Game Theory\nGame theory analyzes the strategic interaction between agents. It has applications in various fields including economics, law, political science, biology, and computer science. This course introduces the basic tools of game theoretic analysis and examines applications such as auctions, business strategy, and curbing carbon emissions. The course includes an experiential learning component where students play strategic games against each other.```\n<http://www.ucalendar.uwaterloo.ca/1920/COURSE/course-ECON.html>", "user": "UGCKJ22GY", "ts": "1576620142.002500", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "cXq=", "elements": [{"type": "rich_text_preformatted", "elements": [{"type": "text", "text": "ECON 212 LEC 0.50\tCourse ID: 015181\nIntroduction to Game Theory\nGame theory analyzes the strategic interaction between agents. It has applications in various fields including economics, law, political science, biology, and computer science. This course introduces the basic tools of game theoretic analysis and examines applications such as auctions, business strategy, and curbing carbon emissions. The course includes an experiential learning component where students play strategic games against each other."}]}, {"type": "rich_text_section", "elements": [{"type": "link", "url": "http://www.ucalendar.uwaterloo.ca/1920/COURSE/course-ECON.html"}]}]}], "channel": "DGD8HTE4T", "event_ts": "1576620142.002500", "channel_type": "im"}, "type": "event_callback", "event_id": "EvREUW2GTC", "event_time": 1576620142, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
