INSERT INTO public.raw_slack_events (id, json_data, last_updated) VALUES (2762, '{"token": "59QsmZYLbhegWMqDtcPvUKkt", "team_id": "TGDAJ0S3E", "api_app_id": "APGL0FF71", "event": {"client_msg_id": "e02d05fc-2829-42cf-a14e-2f2e617c08a5", "type": "message", "text": "&gt;  As such, we need to determine the algorithms/policies for _how_ we deduct that time. For example, there\u2019s the figure that it takes 23 mins for a knowledge worker to recover from an interruption (search: Gloria Mark). There\u2019s also lots of CogErg/Human Factors stuff about task switching and the cognitive/time cost. One simple proposal from exploring some preliminary Slack data (linked below), perhaps an initial rule is after *3 consecutive reads*, we deduct *23 mins*?\n&gt;  Getting the MVP to a done state is the priority, but it\u2019d be good if we can consider some justifiable, science-based approaches/alternatives here. The user has to trust when we tell them they\u2019re interrupted. Ideas on this?\nSo goal of Excel is prototyping different algorithms?", "user": "UGCKJ22GY", "ts": "1576637971.009800", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "Ycn", "elements": [{"type": "rich_text_quote", "elements": [{"type": "text", "text": " As such, we need to determine the algorithms/policies for "}, {"type": "text", "text": "how", "style": {"italic": true}}, {"type": "text", "text": " we deduct that time. For example, there\u2019s the figure that it takes 23 mins for a knowledge worker to recover from an interruption (search: Gloria Mark). There\u2019s also lots of CogErg/Human Factors stuff about task switching and the cognitive/time cost. One simple proposal from exploring some preliminary Slack data (linked below), perhaps an initial rule is after "}, {"type": "text", "text": "3 consecutive reads", "style": {"bold": true}}, {"type": "text", "text": ", we deduct "}, {"type": "text", "text": "23 mins", "style": {"bold": true}}, {"type": "text", "text": "?"}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "\n"}]}, {"type": "rich_text_quote", "elements": [{"type": "text", "text": " Getting the MVP to a done state is the priority, but it\u2019d be good if we can consider some justifiable, science-based approaches/alternatives here. The user has to trust when we tell them they\u2019re interrupted. Ideas on this?"}]}, {"type": "rich_text_section", "elements": [{"type": "text", "text": "\nSo goal of Excel is prototyping different algorithms?"}]}]}], "channel": "DGD8HTE4T", "event_ts": "1576637971.009800", "channel_type": "im"}, "type": "event_callback", "event_id": "EvRU14E49E", "event_time": 1576637971, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ"]}', NULL);
