e duplicate rows and then the job ran successfully"}]}]}], "ts": "1578286181.002100", "user_team": "TGDAJ0S3E", "source_team": "TGDAJ0S3E"}, "channel": "CGD8ER3HR", "previous_message": {"client_msg_id": "a52eb6f9-5649-4c11-9e04-9bba71fe5c8e", "type": "message", "text": "Weird error with `capture_slack_activites_from_stored_raw_json` , in application/scheduled_data_tasks/slack_activities.py\nfor some reason, for _1 slack event_, two rows were created, causing the job to fail (this was weeks ago)\nBecause of the way the job is written, I do not know how it happened. If this error occurs again, I will write some more rigorous validations.\nI went and deleted one of these duplicate rows and then the job ran successfully", "user": "UGCKJ22GY", "ts": "1578286181.002100", "team": "TGDAJ0S3E", "blocks": [{"type": "rich_text", "block_id": "iq5", "elements": [{"type": "rich_text_section", "elements": [{"type": "text", "text": "Weird error with "}, {"type": "text", "text": "capture_slack_activites_from_stored_raw_json", "style": {"code": true}}, {"type": "text", "text": " , in application/scheduled_data_tasks/slack_activities.py\nfor some reason, for "}, {"type": "text", "text": "1 slack event", "style": {"italic": true}}, {"type": "text", "text": ", two rows were created, causing the job to fail (this was weeks ago)\nBecause of the way the job is written, I do not know how it happened. If this error occurs again, I will write some more rigorous validations.\nI went and deleted one of these duplicate rows and then the job ran successfully"}]}]}]}, "event_ts": "1578286275.002200", "ts": "1578286275.002200", "channel_type": "channel"}, "type": "event_callback", "event_id": "EvSA60QXKP", "event_time": 1578286275, "authed_users": ["UGCKJ22GY", "UGDBV8GDQ", "UPHM989GB", "UJCRT0WJH"]}', NULL);
